************************************************************************
      subroutine aec_eceeg50
      implicit real*8(a-h,o-z)

      include 'inclec_ecee1.h'
      include 'inclk.h'
      include 'inclec_eceep.h'
*-----------------------------------------------------------------------
      common /amwork/cfec_ecee29q,av6,av7,av8,av9,av10,av11,
     &               exec_ecee29q,ptec_ecee29q,evec_ecee31c,
     &               eqec_ecee31c,evec_ecee20c,eqec_ecee20c
      common /amwori/lt6,lt7,lt8,lt9,lt10,lt11
*     4144 (4144) + 108 (108) bytes used

      integer    lt6(0:3),lt7(0:3),lt8(0:3),lt9(0:3),lt10(0:4),
     &           lt11(0:5)
      real*8     exec_ecee29q(2),ptec_ecee29q(4,3),
     &           evec_ecee31c(lepinv),eqec_ecee31c(4,lepinv),
     &           evec_ecee20c(lepinv),eqec_ecee20c(4,lepinv)
      complex*16 cfec_ecee29q(2,4)
      complex*16 av6(lextrn*lintrn*lepinv)
      complex*16 av7(lintrn*lextrn*lepinv)
      complex*16 av8(lextrn*lextrn*lepinv)
      complex*16 av9(lextrn*lextrn*lepinv)
      complex*16 av10(lextrn*lepinv*lextrn*lepinv)
      complex*16 av11(lextrn*lextrn*lextrn*lextrn*lepinv)
      complex*16 atmp
*-----------------------------------------------------------------------

* Denominators of propagators
      aprop = 1.0d0
      call snprpd(pphase,aprop,vnec_ecee29,
     &      amuq(2)**2,amuq(2)*aguq(2))
      call snprpd(pphase,aprop,vnec_ecee31,
     &      amz**2,amz*agz)
      call snprpd(pphase,aprop,vnec_ecee20,
     &      amz**2,amz*agz)

* Internal momenta
      call smintf(amuq(2),pfec_ecee29,vnec_ecee29,exec_ecee29q,
     &            ptec_ecee29q,cfec_ecee29q)
      call smintv(lepinv,amz,pfec_ecee31,eqec_ecee31c,evec_ecee31c,
     &            vnec_ecee31,igauzb)
      call smintv(lepinv,amz,pfec_ecee20,eqec_ecee20c,evec_ecee20c,
     &            vnec_ecee20,igauzb)

* Vertices (10)

*     6(0): pfec_ecee29 c
*     6(1): pfec_ecee2 c
*     6(2): pfec_ecee31 z
      call smffv(lextrn,lintrn,lepinv,exec_ecee2q,exec_ecee29q,amuq(2),
     &           amuq(2),czuu(1,2),cfec_ecee2q,cfec_ecee29q,ptec_ecee2q,
     &           ptec_ecee29q,eqec_ecee31c,lt6,av6)

*     7(0): pfec_ecee9 c
*     7(1): pfec_ecee29 c
*     7(2): pfec_ecee20 z
      call smffv(lintrn,lextrn,lepinv,exec_ecee29q,exec_ecee9q,amuq(2),
     &           amuq(2),czuu(1,2),cfec_ecee29q,cfec_ecee9q,
     &           ptec_ecee29q,ptec_ecee9q,eqec_ecee20c,lt7,av7)

*     8(0): pfec_ecee33 electron
*     8(1): pfec_ecee62 electron
*     8(2): pfec_ecee31 z
      call smffv(lextrn,lextrn,lepinv,exec_ecee62m,exec_ecee33m,amlp(1),
     &           amlp(1),czll(1,1),cfec_ecee62m,cfec_ecee33m,
     &           ptec_ecee62m,ptec_ecee33m,eqec_ecee31c,lt8,av8)

*     9(0): pfec_ecee4 electron
*     9(1): pfec_ecee17 electron
*     9(2): pfec_ecee20 z
      call smffv(lextrn,lextrn,lepinv,exec_ecee17m,exec_ecee4m,amlp(1),
     &           amlp(1),czll(1,1),cfec_ecee17m,cfec_ecee4m,
     &           ptec_ecee17m,ptec_ecee4m,eqec_ecee20c,lt9,av9)

      call smconf(lt6,lt7,2,1,exec_ecee29q,av6,av7,lt10,av10)
      call smconv(lt8,lt10,3,2,evec_ecee31c,av8,av10,lt11,av11)
      call smconv(lt9,lt11,3,5,evec_ecee20c,av9,av11,lt,av)

      sym = + 1.0d0
      aprop         = sym/aprop

      indexg(1) = 4
      indexg(2) = 2
      indexg(3) = 6
      indexg(4) = 5
      indexg(5) = 1
      indexg(6) = 3

      call aec_eceempord(lt, av, indexg, agcwrk)

      ancp(jgraph) = 0.0d0
*     nbase = 1
      cwgt = 1.d0
      do 500 ih = 0 , lec_eceeag-1
         atmp    = cwgt*agcwrk(ih)*aprop
         agc(ih) = agc(ih) + atmp
         ancp(jgraph) = ancp(jgraph) + atmp*conjg(atmp)
  500 continue

      return
      end
